INSERT [dbo].[Threshold] ([ID], [Threshold], [CreatedBy], [ModifiedBy], [CreatedOn], [ModifiedOn], [IsDeleted], [ShortDescription], [ThresholdDate], [ThresholdYear], [ThresholdTimeUnit], [BookmarkID], [CurrVersion]) VALUES (N'9d6bc73f-af65-4a92-90bd-4c22c764b3bb', N'2. Origins of the First Stars', NULL, NULL, NULL, CAST(0x9FFA008D AS SmallDateTime), NULL, N'Threshold 2: The Stars Light Up: Stars became the first stable, complex entities to exist in the Universe. This threshold examines the conditions that led up to the first stars lighting up.', NULL, CAST(13.5000 AS Decimal(8, 4)), N'3af91c99-c88b-4145-bf65-2a2ac77ca9b7', NULL, 7)
INSERT [dbo].[Threshold] ([ID], [Threshold], [CreatedBy], [ModifiedBy], [CreatedOn], [ModifiedOn], [IsDeleted], [ShortDescription], [ThresholdDate], [ThresholdYear], [ThresholdTimeUnit], [BookmarkID], [CurrVersion]) VALUES (N'90aaddae-8fea-409a-8e5c-85b30eb7f998', N'3. Origins of Chemical Complexity', NULL, NULL, NULL, CAST(0x9FFA008E AS SmallDateTime), NULL, N'Threshold 3: Dying stars generate temperatures high enough to create entirely new elements. Only very big stars create temperatures high enough to create the rest of the elements.', NULL, CAST(12.0000 AS Decimal(8, 4)), N'3af91c99-c88b-4145-bf65-2a2ac77ca9b7', NULL, 7)
INSERT [dbo].[Threshold] ([ID], [Threshold], [CreatedBy], [ModifiedBy], [CreatedOn], [ModifiedOn], [IsDeleted], [ShortDescription], [ThresholdDate], [ThresholdYear], [ThresholdTimeUnit], [BookmarkID], [CurrVersion]) VALUES (N'49b10256-8270-4991-b3a6-c1bb9812e7bd', N'4. Origins of the Earth and Solar System', NULL, NULL, NULL, CAST(0x9FFA008F AS SmallDateTime), NULL, N'Threshold 4: Elements link up to form more complex molecules. These new materials were necessary for creating our solar system.  ', NULL, CAST(4.5600 AS Decimal(8, 4)), N'3af91c99-c88b-4145-bf65-2a2ac77ca9b7', NULL, 7)
